import React from "react";

class UserClass extends React.Component{
    constructor(props){
        super(props);
        const nam = this.props.name;
        const loc = this.props.location;
    }

    render(){
        return(
            <div>
                <h1>{nam}</h1>
                <h1>{loc}</h1>
            </div>
        )
    }
} 

export default UserClass;
